import React from "react";
import "./style.css";
import { ParallaxLayer } from "@react-spring/parallax";

export default function HeaderMenu() {

    return (
        <ParallaxLayer className="header-menu" sticky={{start: 1, end:2}}>
        <div>

        </div>
          <p>Home</p>
          <p>About</p>
          <p>Works</p>
        </ParallaxLayer>
    );
}
